import React, { Component } from 'react';
import { Link } from "react-router-dom";
import { Navbar } from "react-bootstrap";
import './App.css';

class App extends Component {
  render() {
  return (
    <div className="App">
      <header className="App-header">
        <Navbar fluid collapseOnSelect>
        </Navbar>
      </header>
    </div>
    );
  }
}

export default App;
